import React,{useState} from 'react'

const NewCust = () => {

  const initial = {
    contact:"",
    pincode:'',
  }

  const [userContact,setUserContact] = useState(initial)
  const [branchInfo,setBranchInfo] = useState([])

  let name, value;

  const handleInputs = (e) => {
    // console.log(e);
    name = e.target.name;
    value = e.target.value;

    setUserContact({ ...userContact, [name]: value });
    console.log(userContact);
  };

  const fetchData = async (e) =>{

    e.preventDefault();
    const res = await fetch("/branches",{
      method:"GET"
    })
    const data = await res.json();

    console.log(`This is data from fetch${data}`);
    setBranchInfo([...branchInfo,data])
    console.log(branchInfo);
  }


  const tableRows = branchInfo.map((info,i) => {
    return (
      <tr key={i}>
        <td>{info.branchName}</td>
        <td>{info.pincode}</td>
        <td>{info.place}</td>
        <td>{info.userName}</td>
      </tr>
    );
  });


  return (
    <div>
      <h1>New Customer Contact Form</h1>
      <div>
          <form method='GET'>
              <label>Contact number:</label>
              <input
              type="number"
              name="contact"
              id="contact"
              value={userContact.contact}
              placeholder="Enter your contact number"
              onChange={handleInputs}
              ></input>
              <br/>
              <label>Pincode:</label>
              <input
              type="array"
              name="pincode"
              id="pincode"
              value={userContact.pincode}
              placeholder="Enter pincode of the area"
              onChange={handleInputs}></input>
              <button onClick={fetchData}>Contact Us</button>
          </form>
      </div>
      <div>
        <div>
        <table>
        <thead>
          <tr>
            <th>BranchName</th>
            <th>Pincode</th>
            <th>Place</th>
            <th>Branch Manager</th>
          </tr>
        </thead>
        <tbody>{tableRows}</tbody>
      </table>
        </div>
      </div>
    </div>
  )
}

export default NewCust
